import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <div className = "rmdb-header">
      <div className = "rmdb-header-content">
        <img className = "imdb-logo" src = "./images/reactMovie_logo.png"
         alt = "rmdb-logo" />
         <img className= "rmdb-imdb-logo" src = "./images/tmdb_logo.png"
         alt = "imdb-logo" />
      </div>
    </div>

  )
}

export default Header
